CREATE PROCEDURE [MEMF].[SP_COPY_USER_ROLES]  
   /*
   *   SSMA warning messages:
   *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
   */

   @FRMUSERID float(53),
   /*
   *   SSMA warning messages:
   *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
   */

   @FRMCOPYUSERID float(53),
   @FRMCREATEDBY varchar(max),
   /*
   *   SSMA warning messages:
   *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
   */

   @FRMCOUNT float(53)  OUTPUT
AS 
   BEGIN

      DECLARE
         /*
         *   SSMA warning messages:
         *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
         */

         @TEMPCOUNT float(53) = 0

      BEGIN TRY

         SET @FRMCOUNT = NULL

         DECLARE
            /*
            *   SSMA warning messages:
            *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
            */

            @CURSORROW$ROLE_ID float(53)

         SET @FRMCOUNT = 0

         DECLARE
             ROLESCURSOR CURSOR LOCAL FOR 
               SELECT MEMF_USER_ROLE.ROLE_ID
               FROM MEMF.MEMF_USER_ROLE
               WHERE 
                  MEMF_USER_ROLE.USER_ID = @FRMCOPYUSERID AND 
                  MEMF_USER_ROLE.ROLE_ID IN 
                  (
                     SELECT MEMF_USER_ROLE$2.ROLE_ID
                     FROM MEMF.MEMF_USER_ROLE  AS MEMF_USER_ROLE$2
                     WHERE MEMF_USER_ROLE$2.USER_ID = @FRMCOPYUSERID
                  ) AND 
                  MEMF_USER_ROLE.ROLE_ID NOT IN 
                  (
                     SELECT MEMF_USER_ROLE$3.ROLE_ID
                     FROM MEMF.MEMF_USER_ROLE  AS MEMF_USER_ROLE$3
                     WHERE MEMF_USER_ROLE$3.USER_ID = @FRMUSERID
                  )

         OPEN ROLESCURSOR

         WHILE 1 = 1
         
            BEGIN

               FETCH ROLESCURSOR
                   INTO @CURSORROW$ROLE_ID

               /*
               *   SSMA warning messages:
               *   O2SS0113: The value of @@FETCH_STATUS might be changed by previous FETCH operations on other cursors, if the cursors are used simultaneously.
               */

               IF @@FETCH_STATUS <> 0
                  BREAK

               INSERT MEMF.MEMF_USER_ROLE(
                  ROLE_ID, 
                  USER_ID, 
                  CREATED_BY, 
                  CREATE_TS, 
                  USER_ROLE_ID)
                  VALUES (
                     @CURSORROW$ROLE_ID, 
                     @FRMUSERID, 
                     @FRMCREATEDBY, 
                     sysdatetime(), 
                     NEXT VALUE FOR MEMF.SQ_MEMF_USER_ROLE)

               SET @FRMCOUNT = @FRMCOUNT + 1

            END

         CLOSE ROLESCURSOR

         DEALLOCATE ROLESCURSOR

      END TRY

      BEGIN CATCH
         BEGIN

            SET @TEMPCOUNT = -1

            SET @FRMCOUNT = @TEMPCOUNT

         END
      END CATCH

   END
GO
