CREATE PROCEDURE [MEMF].[SP_EVENTSPURGEALL]  
   /*
   *   SSMA warning messages:
   *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
   */

   @FRMDAYSCOUNT float(53),
   @FRMAPPNAME varchar(max),
   @FRMCOMPONENTNAMES varchar(max),
   @FRMCREATEDBY varchar(max),
   @OUTRESPONSE varchar(max)  OUTPUT
AS 
   BEGIN

      DECLARE
         /*
         *   SSMA warning messages:
         *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
         */

         @PURGE_ID float(53) = 0, 
         @PURGECOUNT int = 0, 
         @PURGERESPONSE varchar(100)

      BEGIN TRY

         SET @OUTRESPONSE = NULL

         DECLARE
            /*
            *   SSMA warning messages:
            *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
            */

            @CURSORROW$EVENT_ID float(53), 
            @CURSORROW$APP_NAME varchar(max), 
            @CURSORROW$COMP_NAME varchar(max), 
            @CURSORROW$COMP_TYPE varchar(max), 
            @CURSORROW$SEVERITY varchar(max), 
            @CURSORROW$EVENT_CATEGORY varchar(max), 
            @CURSORROW$EVENT_CODE varchar(max), 
            @CURSORROW$EVENT_DESC varchar(max), 
            @CURSORROW$SERVER_INSTANCE varchar(max), 
            @CURSORROW$SYSTEM_INFO varchar(max), 
            @CURSORROW$PAYLOAD_TYPE varchar(max), 
            @CURSORROW$PAYLOAD_HEADER varbinary(max), 
            @CURSORROW$PAYLOAD_BODY varbinary(max), 
            @CURSORROW$TRACKING_ID varchar(max), 
            @CURSORROW$CORRL_ID varchar(max), 
            @CURSORROW$MSG_ID varchar(max), 
            @CURSORROW$REPLAYFLAG varchar(max), 
            /*
            *   SSMA warning messages:
            *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
            */

            @CURSORROW$REPLAYFLAG_COUNT float(53)

         SET @PURGERESPONSE = 'empty'

         SELECT @PURGE_ID = 
            CASE 
               WHEN max(MEMF_PURGE_LOG.PURGE_ID) IS NULL THEN 0
               ELSE max(MEMF_PURGE_LOG.PURGE_ID)
            END
         FROM MEMF.MEMF_PURGE_LOG

         SET @PURGE_ID = @PURGE_ID + 1

         INSERT MEMF.MEMF_PURGE_LOG(
            PURGE_ID, 
            PURGED_RECORDS_COUNT, 
            PURGE_STATUS, 
            PURGE_RESPONSE, 
            PURGE_TS, 
            PURGE_BY)
            VALUES (
               @PURGE_ID, 
               @PURGECOUNT, 
               'SUCCESS', 
               NULL, 
               sysdatetime(), 
               @FRMCREATEDBY)

         IF @@TRANCOUNT > 0
            COMMIT TRANSACTION 

         SET @OUTRESPONSE = 'test purge_id=' + ISNULL(CAST(@PURGE_ID AS nvarchar(max)), '') + 'end  '

         DECLARE
             CUR CURSOR LOCAL FOR 
               SELECT 
                  MEMF_EVENT_DETAILS.EVENT_ID, 
                  MEMF_EVENT_DETAILS.APP_NAME, 
                  MEMF_EVENT_DETAILS.COMP_NAME, 
                  MEMF_EVENT_DETAILS.COMP_TYPE, 
                  MEMF_EVENT_DETAILS.SEVERITY, 
                  MEMF_EVENT_DETAILS.EVENT_CATEGORY, 
                  MEMF_EVENT_DETAILS.EVENT_CODE, 
                  MEMF_EVENT_DETAILS.EVENT_DESC, 
                  MEMF_EVENT_DETAILS.SERVER_INSTANCE, 
                  MEMF_EVENT_DETAILS.SYSTEM_INFO, 
                  MEMF_EVENT_DETAILS.PAYLOAD_TYPE, 
                  MEMF_EVENT_DETAILS.PAYLOAD_HEADER, 
                  MEMF_EVENT_DETAILS.PAYLOAD_BODY, 
                  MEMF_EVENT_DETAILS.TRACKING_ID, 
                  MEMF_EVENT_DETAILS.CORRL_ID, 
                  MEMF_EVENT_DETAILS.MSG_ID, 
                  MEMF_EVENT_DETAILS.REPLAYFLAG, 
                  MEMF_EVENT_DETAILS.REPLAYFLAG_COUNT
               FROM MEMF.MEMF_EVENT_DETAILS
               WHERE 
                  MEMF_EVENT_DETAILS.APP_NAME = @FRMAPPNAME AND 
                  MEMF_EVENT_DETAILS.PURGE_FLAG = 0 AND 
                  CAST(ssma_oracle.trunc_date(sysdatetime()) - ssma_oracle.trunc_date(MEMF_EVENT_DETAILS.CREATED_TS) AS float(53)) > @FRMDAYSCOUNT

         OPEN CUR

         WHILE 1 = 1
         
            BEGIN

               FETCH CUR
                   INTO 
                     @CURSORROW$EVENT_ID, 
                     @CURSORROW$APP_NAME, 
                     @CURSORROW$COMP_NAME, 
                     @CURSORROW$COMP_TYPE, 
                     @CURSORROW$SEVERITY, 
                     @CURSORROW$EVENT_CATEGORY, 
                     @CURSORROW$EVENT_CODE, 
                     @CURSORROW$EVENT_DESC, 
                     @CURSORROW$SERVER_INSTANCE, 
                     @CURSORROW$SYSTEM_INFO, 
                     @CURSORROW$PAYLOAD_TYPE, 
                     @CURSORROW$PAYLOAD_HEADER, 
                     @CURSORROW$PAYLOAD_BODY, 
                     @CURSORROW$TRACKING_ID, 
                     @CURSORROW$CORRL_ID, 
                     @CURSORROW$MSG_ID, 
                     @CURSORROW$REPLAYFLAG, 
                     @CURSORROW$REPLAYFLAG_COUNT

               /*
               *   SSMA warning messages:
               *   O2SS0113: The value of @@FETCH_STATUS might be changed by previous FETCH operations on other cursors, if the cursors are used simultaneously.
               */

               IF @@FETCH_STATUS <> 0
                  BREAK

               INSERT MEMF.MEMF_PURGE_EVENT_DETAILS(
                  PURGE_ID, 
                  EVENT_ID, 
                  APP_NAME, 
                  COMP_NAME, 
                  COMP_TYPE, 
                  SEVERITY, 
                  EVENT_CATEGORY, 
                  EVENT_CODE, 
                  EVENT_DESC, 
                  SERVER_INSTANCE, 
                  SYSTEM_INFO, 
                  PAYLOAD_TYPE, 
                  PAYLOAD_HEADER, 
                  PAYLOAD_BODY, 
                  TRACKING_ID, 
                  CORRL_ID, 
                  MSG_ID, 
                  CREATED_TS, 
                  REPLAYFLAG, 
                  REPLAYFLAG_COUNT)
                  VALUES (
                     @PURGE_ID, 
                     @CURSORROW$EVENT_ID, 
                     @CURSORROW$APP_NAME, 
                     @CURSORROW$COMP_NAME, 
                     @CURSORROW$COMP_TYPE, 
                     @CURSORROW$SEVERITY, 
                     @CURSORROW$EVENT_CATEGORY, 
                     @CURSORROW$EVENT_CODE, 
                     @CURSORROW$EVENT_DESC, 
                     @CURSORROW$SERVER_INSTANCE, 
                     @CURSORROW$SYSTEM_INFO, 
                     @CURSORROW$PAYLOAD_TYPE, 
                     @CURSORROW$PAYLOAD_HEADER, 
                     @CURSORROW$PAYLOAD_BODY, 
                     @CURSORROW$TRACKING_ID, 
                     @CURSORROW$CORRL_ID, 
                     @CURSORROW$MSG_ID, 
                     sysdatetime(), 
                     @CURSORROW$REPLAYFLAG, 
                     @CURSORROW$REPLAYFLAG_COUNT)

               UPDATE MEMF.MEMF_EVENT_DETAILS
                  SET 
                     PURGE_FLAG = 1
               WHERE MEMF_EVENT_DETAILS.EVENT_ID = @CURSORROW$EVENT_ID

               SET @PURGECOUNT = @PURGECOUNT + 1

            END

         CLOSE CUR

         DEALLOCATE CUR

         DELETE MEMF.MEMF_EVENT_DETAILS
         WHERE MEMF_EVENT_DETAILS.PURGE_FLAG = 1

         SET @OUTRESPONSE = 
            ISNULL(CAST(@PURGE_ID AS nvarchar(max)), '')
             + 
            '#^$'
             + 
            ISNULL(CAST(@PURGECOUNT AS nvarchar(max)), '')
             + 
            '#^$SUCCESS'
             + 
            '#^$'
             + 
            ISNULL(@PURGERESPONSE, '')

      END TRY

      BEGIN CATCH

         DECLARE
            @errornumber int

         SET @errornumber = ERROR_NUMBER()

         DECLARE
            @errormessage nvarchar(4000)

         SET @errormessage = ERROR_MESSAGE()

         DECLARE
            @exceptionidentifier nvarchar(4000)

         SELECT @exceptionidentifier = ssma_oracle.db_error_get_oracle_exception_id(@errormessage, @errornumber)

         BEGIN

            IF @@TRANCOUNT > 0
               ROLLBACK WORK 

            SET @PURGERESPONSE = ssma_oracle.db_error_sqlerrm_0(@exceptionidentifier, @errornumber)

            SET @OUTRESPONSE = 
               ISNULL(CAST(@PURGE_ID AS nvarchar(max)), '')
                + 
               '#^$'
                + 
               ISNULL(CAST(@PURGECOUNT AS nvarchar(max)), '')
                + 
               '#^$ERROR'
                + 
               '#^$'
                + 
               ISNULL(@PURGERESPONSE, '')

         END

      END CATCH

   END
