CREATE PROCEDURE [MEMF].[SPCREATEUSER]  
   @FRMLOG_ID varchar(max),
   @FRMPASSWD varchar(max),
   @FRMFNME varchar(max),
   @FRMLNME varchar(max),
   @FRMEMAIL varchar(max),
   @FRMOFFICE_PHONE varchar(max),
   @FRMDEPT_ID int,
   @FRMACTIVE varchar(max),
   @FRMCREATED_BY varchar(max),
   @FRMAUTHORIZED_BY varchar(max),
   @FRMAUTHORIZED_TS datetime2,
   /*
   *   SSMA warning messages:
   *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
   */

   @FRMROLE_ID float(53),
   @FRMDATE_ACTIVATED datetime2,
   @FRMACTIVATED_BY varchar(max),
   @FRMPRIORITY int,
   @FRMLASTLOG_TS datetime2,
   @FRMLASTLOGOUT_TS datetime2,
   @RESULT_MESSAGE varchar(max)  OUTPUT
AS 
   BEGIN

     SET @RESULT_MESSAGE = NULL

      DECLARE
         /*
         *   SSMA warning messages:
         *   O2SS0356: Conversion from NUMBER datatype can cause data loss.
         */

         @LASTID float(53) = 0

      INSERT MEMF.M_USER(
         ID, 
         LOGINID, 
         PASSWD, 
         FNME, 
         LNME, 
         EMAIL, 
         OFFICE_PHONE, 
         DEPT_ID, 
         ACTIVE, 
         CREATED_BY, 
         AUTHORIZED_BY, 
         AUTHORIZED_TS, 
         LAST_LOGIN_TS, 
         LAST_LOGOUT_TS)
         VALUES (
            NEXT VALUE FOR MEMF.SQ_M_USER, 
            @FRMLOG_ID, 
            @FRMPASSWD, 
            @FRMFNME, 
            @FRMLNME, 
            @FRMEMAIL, 
            @FRMOFFICE_PHONE, 
            @FRMDEPT_ID, 
            @FRMACTIVE, 
            @FRMCREATED_BY, 
            @FRMAUTHORIZED_BY, 
            @FRMAUTHORIZED_TS, 
            @FRMLASTLOG_TS, 
            @FRMLASTLOGOUT_TS)

      /*SELECT MAX(ID) TO LASTID FROM MEMF.M_USER FETCH FIRST 1 ROWS ONLY;*/
      SELECT @LASTID = 
         CASE 
            WHEN max(M_USER.ID) IS NULL THEN 0
            ELSE max(M_USER.ID)
         END
      FROM MEMF.M_USER

      
      /*
      *    MEMF_USER_ROLE ROLE_ID USER_ID CREATED_BY CREATE_TS LAST_UPDATED_BY LAST_UPDATED_TS
      *    SERT TO M_USER_ROLES (USER_ID, ROLE_ID, PRIORITY, DATE_ACTIVATED, ACTIVATED_BY)
      *    VALUES (LASTID, frmROLE_ID, frmPRIORITY, frmDATE_ACTIVATED, frmACTIVATED_BY);
      */
      INSERT MEMF.MEMF_USER_ROLE(
         USER_ROLE_ID, 
         USER_ID, 
         ROLE_ID, 
         CREATE_TS, 
         CREATED_BY)
         VALUES (
            NEXT VALUE FOR MEMF.SQ_MEMF_ROLES, 
            @LASTID, 
            @FRMROLE_ID, 
            @FRMDATE_ACTIVATED, 
            @FRMACTIVATED_BY)

      SET @RESULT_MESSAGE = 'Success '

   END
GO
