GO
CREATE PROCEDURE [ssma_oracle].[DBMS_SQL_EXECUTE_AND_FETCH]
    @cursor int,
    @count int OUTPUT
AS
  BEGIN
    declare @rows_processed int

    EXEC [ssma_oracle].DBMS_SQL_EXECUTE @cursor, @rows_processed OUTPUT
    EXEC [ssma_oracle].DBMS_SQL_FETCH_ROWS$IMPL @cursor, @count OUTPUT
    SET @count = 1
  END
GO
/****** Object:  StoredProcedure [ssma_oracle].[DBMS_SQL_FETCH_ROWS$IMPL]    Script Date: 3/30/2021 4:59:47 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [ssma_oracle].[DBMS_SQL_FETCH_ROWS$IMPL]
   @cursor int,
   @count int  OUTPUT
AS 
   BEGIN
      SET NOCOUNT ON
      SET @count = 0
      UPDATE ssma_oracle.v_dbms_sql_cursor
         SET current_row = ISNULL(current_row,0)+1,
            @count = 1
       WHERE id = @cursor
         AND ISNULL(current_row,0) < ISNULL(last_row,0)
   END
GO
