/****** Object:  StoredProcedure [ssma_oracle].[sp_ExtendCollection]    Script Date: 3/30/2021 4:59:47 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE procedure [ssma_oracle].[sp_ExtendCollection]
  (@x XML output, @n int = 1, @i int = 0)
  AS
BEGIN
  DECLARE @_copy nvarchar(max), @x_last int, @x_add xml
  IF @x IS NULL SET @x = ''

  IF @i <> 0 SELECT @_copy = T.c.value('(val)[1]', 'nvarchar(max)') FROM @x.nodes('collection/item') T(c) 
     WHERE T.c.value('@key', 'int') = @i

  SELECT @x_last = ISNULL(MAX(T.c.value('@key', 'int')),0)
    FROM @x.nodes('collection/item') T(c)

  ;with cte as
  (
    select @x_last+1 as level
     union all
    select level + 1 as level
      from cte
  )
   select @x_add = 
     (
       select top (@n) level as "@key", @_copy as "val" from cte 
          FOR XML PATH('item'), TYPE
     )
  OPTION (MAXRECURSION 0)

SET @x = CAST('<collection>' + CAST(@x.query('collection/item') as NVARCHAR(MAX)) + 
            CAST(@x_add as NVARCHAR(MAX)) +'</collection>' as xml)
END
GO
/****** Object:  StoredProcedure [ssma_oracle].[sp_TrimCollection]    Script Date: 3/30/2021 4:59:47 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [ssma_oracle].[sp_TrimCollection]
  @x XML OUTPUT, @n int = 1
  AS
BEGIN
IF @x IS NULL return
DECLARE @max_value int,@min_value int
if @n=1 begin
select @max_value=max(T.c.value('@key', 'int')) FROM @x.nodes('collection/item') T(c)
SET @x.modify('delete (collection/item[@key=sql:variable("@max_value")][1])')
end
else begin
select @max_value=max(val),@min_value=min(val) from(
 select top (@n) val from
 (select T.c.value('@key', 'int') val FROM @x.nodes('collection/item') T(c)) a
 order by val desc) b
SET @x.modify('delete (collection/item[@key<=sql:variable("@max_value") and @key>=sql:variable("@min_value")])')
end
END
GO
/****** Object:  StoredProcedure [ssma_oracle].[ssma_rethrowerror]    Script Date: 3/30/2021 4:59:47 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [ssma_oracle].[ssma_rethrowerror] AS
    
    IF ERROR_NUMBER() IS NULL
        RETURN;

    DECLARE 
        @errormessage    NVARCHAR(4000),
        @errornumber     INT,
        @errorseverity   INT,
        @errorstate      INT,
        @errorline       INT,
        @errorprocedure  NVARCHAR(200);

    SELECT 
        @errornumber = ERROR_NUMBER(),
        @errorseverity = ERROR_SEVERITY(),
        @errorstate = ERROR_STATE(),
        @errorline = ERROR_LINE(),
        @errorprocedure = ISNULL(ERROR_PROCEDURE(), '-');

    SELECT @errormessage = 
        N'Error %d, Level %d, State %d, Procedure %s, Line %d, ' + 
            'Message: '+ ERROR_MESSAGE();

    RAISERROR 
        (
        @errormessage, 
        @errorseverity, 
        1,               
        @errornumber,    
        @errorseverity,  
        @errorstate,     
        @errorprocedure, 
        @errorline       
        );
GO
/****** Object:  StoredProcedure [ssma_oracle].[utl_file_fclose]    Script Date: 3/30/2021 4:59:47 PM ******/
