/****** Object:  StoredProcedure [ssma_oracle].[utl_file_fopen$impl]    Script Date: 3/30/2021 4:59:47 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER OFF
GO
CREATE PROCEDURE [ssma_oracle].[utl_file_fopen$impl] 
  @LOCATION  varchar(255),
  @FILENAME varchar(255),
  @OPEN_MODE varchar(255),
  @MAX_LINESIZE int = 1024,
  @return_value_argument XML OUTPUT 
AS
BEGIN
  DECLARE @FullName varchar(512),
   @FSO int,
   @FileID int,
   @pRes int
   
  SET @return_value_argument = ''

  IF (upper(@OPEN_MODE) != 'W') AND (upper(@OPEN_MODE) != 'A') AND (upper(@OPEN_MODE) != 'R')
    BEGIN
      RAISERROR (59999, 16, 1, N'local:oracle:{sysdb|UTL_FILE_FOPEN}:INVALID_MODE_DATA_EXCEPTION:0')
    RETURN
    END 

  IF (@MAX_LINESIZE not between 1 and 8000)
    BEGIN
      RAISERROR (59999, 16, 1, N'local:oracle:{sysdb|UTL_FILE_FOPEN}:VALUE_ERROR_EXCEPTION:1')
    RETURN
    END 

  EXEC @pRes = sp_OACreate 'Scripting.FileSystemObject', @FSO output
  IF @pRes != 0  
    BEGIN
      RAISERROR (59999, 16, 1, N'local:oracle:{sysdb|UTL_FILE_FOPEN}:INVALID_OPERATION_EXCEPTION:2')
    RETURN
    END 
  SET @FullName = @LOCATION + '/' + @FILENAME 

  IF (upper(@OPEN_MODE) = 'W')
    EXEC @pRes = sp_OAMethod @FSO, 'OpenTextFile', @FileID output, @FullName, 2, 1 
   ELSE
    IF (upper(@OPEN_MODE) = 'A')
      EXEC @pRes = sp_OAMethod @FSO, 'OpenTextFile', @FileID output, @FullName, 8, 1 
     ELSE
      IF (upper(@OPEN_MODE) = 'R')
       EXEC @pRes = sp_OAMethod @FSO, 'OpenTextFile', @FileID output, @FullName, 1, 0

  IF @pRes = 0 
    SET @return_value_argument =  convert(char(50),@FSO) + convert(char(50),@FileID)
  ELSE
      RAISERROR (59999, 16, 1, N'local:oracle:{sysdb|UTL_FILE_FOPEN}:INVALID_PATH_EXCEPTION:3')
END
GO
/****** Object:  StoredProcedure [ssma_oracle].[utl_file_get_line]    Script Date: 3/30/2021 4:59:47 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER OFF
GO
CREATE  PROCEDURE [ssma_oracle].[utl_file_get_line]
 @FILE XML,
 @BUFFER varchar(8000) output,
 @LEN int = null
AS
BEGIN
  DECLARE @FileID int,
     @pRes int,
   @EOF int,
   @EOL int,
   @lLine varchar(8000)

  SET @BUFFER = ''
  SET @pRes = 1
  IF convert(char(100),@FILE) = '' 
    BEGIN  
      RAISERROR (59999, 16, 1, N'local:oracle:{sysdb|UTL_FILE_GET_LINE}:INVALID_FILEHANDLE_EXCEPTION:0')
    RETURN 
    END

  SET @FileID = convert(int, substring(convert(char(100),@FILE),51,50))  

  SET @BUFFER = ''

  exec sp_OAGetProperty @FileID, 'AtEndOfStream', @EOF output    
  IF @EOF = 1
   BEGIN
      RAISERROR (59999, 16, 1, N'local:oracle:{sysdb|UTL_FILE_GET_LINE}:NO_DATA_FOUND_EXCEPTION:1')
    RETURN
   END

  IF @LEN is null 
   BEGIN
    EXEC @pRes = sp_OAMethod @FileID, 'ReadLine', @BUFFER output
    IF @pRes != 0 
     BEGIN
        RAISERROR (59999, 16, 1, N'local:oracle:{sysdb|UTL_FILE_GET_LINE}:READ_ERROR1_EXCEPTION:2')
       RETURN
     END
   END
   ELSE
   WHILE @LEN > 0
    BEGIN
     exec sp_OAGetProperty @FileID, 'AtEndOfLine', @EOL output    
     IF @EOL = 1 
      BEGIN
        EXEC @pRes = sp_OAMethod @FileID, 'ReadLine', @lLine output
        IF @pRes != 0 
         BEGIN
          RAISERROR (59999, 16, 1, N'local:oracle:{sysdb|UTL_FILE_GET_LINE}:READ_ERROR2_EXCEPTION:3')
          RETURN
         END
        SET @BUFFER = @BUFFER + @lLine
 BREAK
      END
     EXEC @pRes = sp_OAMethod @FileID, 'Read', @lLine output, @characters = 1
     IF @pRes != 0 
      BEGIN
        RAISERROR (59999, 16, 1, N'local:oracle:{sysdb|UTL_FILE_GET_LINE}:READ_ERROR3_EXCEPTION:4')
        RETURN
      END
     SET @BUFFER = @BUFFER + @lLine
     SET @LEN = @LEN - 1
    END

END
GO
